import React, { useState, useEffect } from "react";
import { fetchContributionData } from "../services/fetchCommits";
import "../styles/styles.css";
import { Pie } from "react-chartjs-2";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js";

// Initialize Chart.js components
ChartJS.register(ArcElement, Tooltip, Legend);

const Dashboard = () => {
    const [selectedOrg, setSelectedOrg] = useState("");
    const [selectedRepo, setSelectedRepo] = useState("");
    const [selectedUser, setSelectedUser] = useState("");
    const [contributions, setContributions] = useState([]);

    const ORGANIZATIONS = {
        "HWAI-MarketIntel": ["EnrollmentTrendsUI-R4", "EnrollmentTrendsAPI-R4", "CompetitorAnalysisUI-R1", "CompetitorAnalysisAPI-R1"],
        "HWAI-NetworkIntel": ["PNCOneToManyUI-R1", "PNCOneToManyAPI-R1", "NetworkAdequacyUI-R1", "NetworkAdequacyAPI-R1", "NPISearchUI-R4", "ProviderNetworkComparisonUI-R4", "ProviderNetworkComparisonAPI-R4", "NPISearchAPI-R4"],
        "HWAI-XAI": ["ProductScorecardUI-R1", "BenefitSimulatorUI-R3.1", "BenefitSimulatorAPI-R3.1", "BenefitSimulatorAPI-R3", "ProductScorecardAPI-R1", "BenefitSimulatorUI-R3"]
    };

    const USERS = ["ArulTEG", "ArunPrem_APP", "deepesh-tech", "Mukul Kumar", "suneelkumar02", "dhorinaresh", "ankit_sde@hwai", "bindu-e", "Kritika-sharma12", "Promod Kr Verma", "satyajeet-HealthworksAI", "Rajeev Rawat", "vibhore-go", "vidushi-chaudhary"];

    // Fetch contribution data
    const handleFetchData = async () => {
        if (!selectedOrg || !selectedRepo) {
            alert("Please select an organization and repository!");
            return;
        }
        const data = await fetchContributionData(selectedOrg, selectedRepo);
        setContributions(data);
    };

    // Calculate total commits and percentage
    const totalCommits = contributions.reduce((sum, user) => sum + user.commits, 0);
    const contributionData = contributions.map((user) => ({
        ...user,
        percentage: totalCommits > 0 ? ((user.commits / totalCommits) * 100).toFixed(2) : 0
    }));

    // Prepare data for the Pie Chart
    const chartData = {
        labels: contributionData.map(user => user.user),
        datasets: [{
            data: contributionData.map(user => user.percentage),
            backgroundColor: ["#FF6384", "#36A2EB", "#FFCE56", "#4CAF50", "#9966FF", "#FF9900", "#FF5733", "#33FF57"],
            hoverBackgroundColor: ["#FF6384", "#36A2EB", "#FFCE56", "#4CAF50", "#9966FF", "#FF9900", "#FF5733", "#33FF57"]
        }]
    };

    return (
        <div className="dashboard-container">
            {/* Header */}
            <div className="header">
                <div className="logo">HealthWorks AI</div>
                <div className="user-info">ðŸ‘¤ Naresh</div>
            </div>

            {/* Filters Section */}
            <div className="filter-section">
                <div className="dropdown">
                    <label>Organization</label>
                    <select value={selectedOrg} onChange={(e) => setSelectedOrg(e.target.value)}>
                        <option value="">Select Organization</option>
                        {Object.keys(ORGANIZATIONS).map((org) => (
                            <option key={org} value={org}>{org}</option>
                        ))}
                    </select>
                </div>

                <div className="dropdown">
                    <label>Repository</label>
                    <select value={selectedRepo} onChange={(e) => setSelectedRepo(e.target.value)} disabled={!selectedOrg}>
                        <option value="">Select Repository</option>
                        {selectedOrg && ORGANIZATIONS[selectedOrg].map((repo) => (
                            <option key={repo} value={repo}>{repo}</option>
                        ))}
                    </select>
                </div>

                <button className="execute-btn" onClick={handleFetchData}>Execute</button>
            </div>

            {/* Contribution Percentage Table */}
            <div className="table-container">
                <table>
                    <thead>
                        <tr>
                            <th>User</th>
                            <th>Commits</th>
                            <th>Contribution %</th>
                        </tr>
                    </thead>
                    <tbody>
                        {contributionData.length > 0 ? (
                            contributionData.map((user, index) => (
                                <tr key={index}>
                                    <td>{user.user}</td>
                                    <td>{user.commits}</td>
                                    <td>{user.percentage}%</td>
                                </tr>
                            ))
                        ) : (
                            <tr>
                                <td colSpan="3" className="no-data">No data available</td>
                            </tr>
                        )}
                    </tbody>
                </table>
            </div>

            {/* Pie Chart */}
            {contributionData.length > 0 && (
                <div className="chart-container">
                    <h3>Commit Contribution (%)</h3>
                    <Pie data={chartData} />
                </div>
            )}
        </div>
    );
};

export default Dashboard;
